import React from "react";
import Home from "./Home";
import TestDetail from "./TestDetail"
import GoodScore from "./GoodScore";
import GetAdmission from "./GetAdmission";
import Contact from './Contact';


import { BrowserRouter as Routes, Route ,Router} from 'react-router-dom';

const Route1=()=>
{
    return (
        <>
        <Router>
            <Routes>
                <Route  to="/" element={<Home/>} />
                
                <Route to="/contact" element={<Contact/>} />
                
                <Route exact  path="/Testdetail" element={<TestDetail/>} />
            
                <Route exact path="/GoodScore" element={<GoodScore/>} />
            
                <Route exact  path="/Getadmission" element={<GetAdmission/>} />
            </Routes>
    </Router>
        
        </>
    )
}

export default Route1;
